    /// @notice postcondition forall (uint h) _values[h] <= __verifier_old_uint(_balances[_ids[h]][_from]) || !(0 <= h && h < _ids.length)
    /// @notice postcondition _to != address(0)
    /// @notice postcondition _ids.length == _values.length
    /// @notice postcondition _from == __verifier_old_address(_from)
    /// @notice postcondition forall (uint j) _balances[_ids[j]][_from] == __verifier_old_uint(_balances[_ids[j]][_from]) - _values[j] || !(0 <= j && j < _ids.length)
    /// @notice postcondition forall (uint x) _balances[_ids[x]][_to] == __verifier_old_uint(_balances[_ids[x]][_to]) + _values[x] || !(0 <= x && x < _ids.length)
    function safeBatchTransferFrom(address _from, address _to, uint256[] memory _ids, uint256[] memory _values) public;
